'''
The Rabin–Karp algorithm or Karp–Rabin algorithm is a string-searching algorithm created by Richard M. Karp and Michael O. Rabin (1987) that uses hashing to find an exact match of a pattern string in a text. It uses a rolling hash to quickly filter out positions of the text that cannot match the pattern, and then checks for a match at the remaining positions. Generalizations of the same idea can be used to find more than one match of a single pattern, or to find matches for more than one pattern. 
'''

def Rabin_Karp_Matcher(text, pattern, d, q):
    n = len(text)
    m = len(pattern)
    h = pow(d,m-1)%q
    p = 0
    t = 0
    result = []
    
    # Preprocessing
    for i in range(m): 
        p = (d*p+ord(pattern[i]))%q
        t = (d*t+ord(text[i]))%q
    
    #DEBUG
    print ("p: {}".format(p))
    print ("t: {}".format(t))    
    
    for s in range(n-m+1): # note the +1
    	# This is the part I want to lose to actually make this fast
    	# I think using a q of 999999937 should produce a valid answer
    	# in most circumstances to just check hash equivalency
    	
        if p == t: # check character by character
            match = True
            for i in range(m):
                if pattern[i] != text[s+i]:
                    match = False
                    break
            if match:
                result = result + [s]
        if s < n-m:
            t = (t-h*ord(text[s]))%q # remove letter s
            t = (t*d+ord(text[s+m]))%q # add letter s+m
            t = (t+q)%q # make sure that t >= 0
    return result
    
    
def test_Rabin_Karp_Matcher():
	print (Rabin_Karp_Matcher ("3141592653589793", "26", 257, 999999937))
	print (Rabin_Karp_Matcher ("xxxxx", "xx", 40999999, 999999937))
	print (Rabin_Karp_Matcher ("aaababaa", "aba", 26, 999999937))
    
    
