def longestDupSubstring(S):
	ub = len(S) - len(set(S)) # binary search upper bound
	lb = 0 # binary search lower bound
	
	# Rabin-Karp Parameters
	n = len(S)
	q = 999999937
	d = 257
	res = ''
    
	while ub > lb:
		subset = []
		m = lb + ((ub - lb) // 2) + 1
		h = pow(d, m-1) % q
		t = 0
		found = False
        
		# Preprocess characters = to length
		for i in range(m):
			t = (d * t + ord(S[i])) % q
		subset.append(t)

		for i in range(n-m):
			t = (t - h * ord(S[i])) % q # remove letter i
			t = (t * d + ord(S[i+m])) % q # add letter i+m
			t = (t + q) % q # make sure that t >= 0

			# if we find a match, set that as our current result
			# and increase our lower bound
			if t in subset:
				lb = m
				res = S[i+1:i+m+1]
				found = True
				break

			subset.append(t)
                
		# if no matches are found decrease our upper bound
		if found == False:
			ub = m - 1

	return res 


