def RabinFingerprint(text, m):
	n = len(text)
	q = 999999937
	h = pow(26, m-1) % q

	t = 0
	result = []
    
	# Preprocess m characters
	for i in range(m):
		t = (26 * t + ord(text[i])) % q
	result.append(t)
	
    
	for i in range(n-m):
		t = (t - h * ord(text[i])) % q # remove letter s
		t = (t * 26 + ord(text[i+m])) % q # add letter s+m
		t = (t + q) % q # make sure that t >= 0
		result.append(t)
    
	return result


def test_Rabin_Fingerprint():
	print(RabinFingerprint("aaababaa", 3))

  
def substringTest(text, m):
	n = len(text)
	q = 999999937
	h = pow(26, m-1) % q
	substrings = []
	
	for i in range(n-m+1):
		substrings.append(text[i:i+m])
		
	fingerprints = []
	for substr in substrings:
		t = 0
		for i in range(m):
			t = (26 * t + ord(substr[i])) % q
		fingerprints.append(t)
		
	return substrings, fingerprints
    
def test_substring():
	substrings, fingerprints = substringTest("aaababaa", 3)
	print (substrings)
	print (fingerprints)    


